import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { SpeedSlalomBasic, SSRdetails } from '../Model/Interface';

const host = 'localhost:3001';

interface AthletesSSRecordsData {
  [athleteName: string]: SSRdetails[];
}

const AnalyzeSSR = () => {
  const [AthletesSSRecordsData, setAthletesSSRecordsData] = useState<AthletesSSRecordsData>({});
  const [showSSRecords, setShowSSRecords] = useState(false);

  useEffect(() => {
    axios.get(`http://${host}/api/getSSRecords?recordType=Details`)
      .then(response => {
        setAthletesSSRecordsData(response.data);
        console.log(AthletesSSRecordsData.athleteName);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);



  return (
    <div>
      <button onClick={() => axios.get(`http://${host}/api/getSSRecords?recordType=Details`)
      .then(response => {
        setAthletesSSRecordsData(response.data);
        console.log(AthletesSSRecordsData.athleteName);
      })
      .catch(error => {
        console.error(error);
      })}>Request Details SSRecords</button>

      {Object.keys(AthletesSSRecordsData).map(athleteName => (
        <div key={athleteName}>
          <h2>{athleteName}</h2>
          <table>
            <thead>
              <tr>
                <th>Athlete</th>
                <th>Side</th>
                <th>Step</th>
                <th>Time</th>
                <th>Missed Cone</th>
                <th>Kicked Cone</th>
                <th>DQ</th>
                <th>End Line</th>
                <th>SSResult</th>
                <th>Notes</th>
              </tr>
            </thead>
            <tbody>
            {Object.entries(AthletesSSRecordsData).map(([athleteName, records]) => (
              records.map((SSRecord, recordIndex) => (
                <tr key={`${athleteName}-${recordIndex}`}>
                  <td>{athleteName}</td>
                  <td>{SSRecord.side}</td>
                  <td>{SSRecord.step}</td>
                  <td>{SSRecord.time}</td>
                  <td>{SSRecord.missedCone}</td>
                  <td>{SSRecord.kickedCone}</td>
                  <td>{SSRecord.DQ.toString()}</td>
                  <td>{SSRecord.endLine.toString()}</td>
                  <td>{SSRecord.SSResult}</td>
                  <td>{SSRecord.notes}</td>
                </tr>
              ))
            ))}
            </tbody>
          </table>
        </div>
      ))}

    </div>
  );
}

export default AnalyzeSSR;
